INSERT INTO `v1_676748814c54ad45d2a8971a63e1709393e01ff407db70d382790afb856fb03d` VALUES ("2030/12/31 15:00:00", 0, 37, "かりん", 118501, 118501, 2, "【魔法】後衛で皆を支える、ギルド管理協会の職員さん。\n通常攻撃の代わりに味方の能力を高める魔法を掛け、\n味方の守護や敵への妨害など、完璧なサポートをこなす。", 1, 787, 0, 0, "2021/10/19 12:00:00", 0, 1, 0, 37, 2.0, 0, 450, 0, 118501, "カリン", 0, 118501);
INSERT INTO `v1_676748814c54ad45d2a8971a63e1709393e01ff407db70d382790afb856fb03d` VALUES ("2030/12/31 15:00:00", 0, 0, "ねびあ", 118601, 118601, 2, "【魔法】後衛を飛び出し悪戯の限りを尽くす幻惑の妖精。\n敵陣を勝手気ままに飛び回り、敵の攻撃を空振りさせて、\nＵＢで４種の妨害効果をランダムに与え大混乱に陥れる。", 3, 826, 0, 0, "2024/08/10 21:00:00", 0, 1, 0, 0, 2.0, 0, 450, 0, 118601, "ネビア", 0, 118601);
INSERT INTO `v1_676748814c54ad45d2a8971a63e1709393e01ff407db70d382790afb856fb03d` VALUES ("2030/12/31 15:00:00", 15, 7, "いお", 119001, 119001, 2, "【魔法】後衛で魔法アタッカーを妨害する闇のせんせー。\n最も魔法攻撃力が高い敵を、誘惑とＴＰダウンで妨害し\nＴＰ回復スキルで味方を援護することで戦況を支配する。", 3, 714, 0, 0, "2021/11/03 19:00:00", 0, 0, 0, 7, 2.27, 0, 450, 0, 119001, "イオ（ノワール）", 0, 119001);
INSERT INTO `v1_676748814c54ad45d2a8971a63e1709393e01ff407db70d382790afb856fb03d` VALUES ("2030/12/31 15:00:00", 12, 7, "くうか", 119101, 119101, 2, "【魔法】前衛で、猛攻をバリアで受けきる闇のドＭ娘。\n最も魔法攻撃力が高い味方の魔法攻撃力とクリティカルを\nアップさせ、魔法防御力ダウンスキルで敵を怯ませる。", 3, 143, 0, 0, "2021/11/16 12:00:00", 0, 0, 0, 26, 2.545, 0, 450, 0, 119101, "クウカ（ノワール）", 0, 119101);
INSERT INTO `v1_676748814c54ad45d2a8971a63e1709393e01ff407db70d382790afb856fb03d` VALUES ("2030/12/31 15:00:00", 5, 6, "まひる", 119201, 119201, 1, "【物理】中衛で味方を支援し、守護する聖夜の牧場主。\n範囲内の敵をノックバックさせることで相手の隊列を崩し\n全体物理バリア展開と単体ＨＰ回復で激戦を勝利に導く。", 1, 397, 0, 0, "2023/09/19 15:00:00", 0, 1, 0, 6, 2.19, 0, 450, 0, 119201, "マヒル（クリスマス）", 0, 119201);
INSERT INTO `v1_676748814c54ad45d2a8971a63e1709393e01ff407db70d382790afb856fb03d` VALUES ("2030/12/31 15:00:00", 6, 8, "りの", 119301, 119301, 1, "【物理】後衛で、攻撃と支援を担う聖夜のアーチャー。\n物理攻撃力と物理クリティカルアップスキルで周囲を強化\nし、クリティカルで威力が増大するＵＢで敵を粉砕する。", 3, 762, 0, 0, "2021/12/22 12:00:00", 0, 0, 0, 8, 1.97, 0, 450, 0, 119301, "リノ（クリスマス）", 0, 119301);
